    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    height: 95%;
`;

const Div = styled.div`
    width: 90%;
    height: 95%;
    overflow: auto;
    margin-top: 20px;
    display: flex;
    flex-direction: column;
    justify-content: top;
    border-style: solid;

    @media screen and (max-width: 700px){
        font-size: 70%;
    }
`;

const Select = styled.select`
    width: 90%;
    height: 2em;
`;

const BottomDiv = styled.div`
    width: 100%;
    height: 4%;
    display: flex;
    margin-top: auto;
    margin-bottom: 0.5em;
`;

const Button = styled.button`
    width: 6em;
    height: 3em;
    margin: auto 0.5em 0 auto;

    @media screen and (max-width: 700px){
        font-size: 70%;
    }
`;

//#endregion

const OnHold = () => {
    return (
        <div>
            OnHold
        </div>
    )
}

export default OnHold
